import { useState } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

let exampleData = [
  {
    title: 'topic one',
    timeEstimate: 5,
    textDescription: 'this is topic 1 description',
  },
  {
    title: 'topic2',
    timeEstimate: 10,
    textDescription: 'this is topic 2 description',
  },
  {
    title: 'topic3',
    timeEstimate: 15,
    textDescription:
      'this is topic 3 description blabdlabdlbwa ahwjkdh awjhd awjwdh hwajk dwja dhwja dwhaj dawj',
  },
];
function App() {
  const [agendaData, setAgendaData] = useState(exampleData);

  return (
    <div id='App'>
      <div id='agenda__container'>
        <h2>Agenda Plan</h2>
        {agendaData.map((elm, index) => {
          return (
            <div className='agenda-topic__container' key={elm.title + index}>
              <h4 style={{ gridColumnStart: 'col1' }}>{elm.title}</h4>
              <p style={{ textAlign: 'center', color: '#5a585C' }}>
                {elm.timeEstimate + 'mins'}
              </p>
              <p>{elm.textDescription}</p>
              <div class='dropdown'>
                <button
                  class='btn btn-secondary dropdown-toggle'
                  type='button'
                  id='dropdownMenuButton'
                  data-toggle='dropdown'
                  aria-haspopup='true'
                  aria-expanded='false'
                >
                  Dropdown button
                </button>
                <div class='dropdown-menu' aria-labelledby='dropdownMenuButton'>
                  <a class='dropdown-item' href='#'>
                    Action
                  </a>
                  <a class='dropdown-item' href='#'>
                    Another action
                  </a>
                  <a class='dropdown-item' href='#'>
                    Something else here
                  </a>
                </div>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default App;
